b.put("templates/directive/casino-biggest-winners-v2.html",'<div class="casino-gamer top-winners-wrapper"><div class=tab-winners><ul><li ng-if=biggestWinners.lastWinners ng-class="{\'active\': activeTab === \'last\'}" ng-click="changeTab(\'last\')" trans>Last Winners</li><li ng-if=biggestWinners.topWinners ng-class="{\'active\': activeTab === \'top\'}" ng-click="changeTab(\'top\')" trans>Top Winners</li></ul></div><div class=casino-scroll-block><ul class=casino-games-row ng-repeat="winner in winners track by $index" ng-show="!winnersLoading || winners"><li class=winners-avatar><span style="background-image: url({{externalImages[winner.game_id]}});"></span></li><li class=info-winners><p ng-bind=winner.player_user_name></p><b ng-bind=winner.game_name></b></li><li class=winner-cost><p>{{winner.win_amount|number:$root.conf.balanceFractionSize}} {{winner.currency_id|currency}}</p></li></ul></div><span ng-if="!winnersLoading && (!winners || !winners.length)" trans>There are no winners</span><vbet-loader ng-if=winnersLoading></vbet-loader></div>');
