b.put("templates/livebox/agentBetHistory.html",'<div class="mixed-view-body-ins always-scroll"><vbet-loader ng-if=!betHistoryLoaded></vbet-loader><div class=mixed-history-table ng-show=betHistoryLoaded><table><thead><tr><th class=date-id><span trans>Date</span></th><th class=hh-cell trans>Balance</th><th class=hh-cell trans>Deposit</th><th class=hh-cell trans>Bet</th><th class=hh-cell trans>Win</th><th class=hh-cell trans>Withdrawal</th><th class=hh-cell trans>Profit</th></tr></thead><tbody ng-repeat="bet in agentBetHistory | orderBy:\'date_time\':true"><tr class=main><td class=date-id><span ng-if="bet.Date !== 0">{{bet.Date|formatDate:(conf.layoutTimeFormat[conf.sportsLayout] || \'noLocaleTranslate\'):null:$root.env.timeFormat}} {{conf.layoutTimeFormat[conf.sportsLayout]? (bet.Date|formatDate:\'hour\':null:$root.env.timeFormat): \'\'}}</span> <span ng-if="bet.Date === 0" trans>Total</span></td><td class="hh-cell odd-color center-text"><span ng-bind=bet.Balance></span></td><td class="hh-cell odd-color center-text"><span ng-bind=bet.DepositAmount></span></td><td class="hh-cell odd-color center-text"><span ng-bind=bet.SportBetAmount></span></td><td class="hh-cell odd-color center-text"><span ng-bind=bet.SportWinAmount></span></td><td class="hh-cell odd-color center-text"><span ng-bind=bet.WithdrawalAmount></span></td><td class="hh-cell odd-color center-text"><span ng-bind="bet.SportBetAmount - bet.SportWinAmount"></span></td></tr></tbody><tbody ng-if="agentBetHistory && agentBetHistory.length == 0"><tr><td colspan=9 class="second-color center-text" trans>There are no bets for the selected time period.</td></tr></tbody></table></div></div>');
b.put("templates/livebox/betHistoryIcons.html",'<div class="bet-history-icon superbet-icon" ng-if=bet.is_super_bet title="{{\'Superbet\'|translate}}"></div><div class="bet-history-icon freebet-icon" ng-if="!bet.amount && bet.bonus_bet_amount && bet.client_bonus_id" title="{{\'Freebet\'|translate}}"></div><div class="bet-history-icon gift-icon" ng-if=bet.is_bonus_money title="{{\'Bonus Money\'|translate}}"></div><div class="bet-history-icon profit-icon" ng-if="bet.amount && !bet.bonus_bet_amount && bet.client_bonus_id" title="{{\'Profit Boost\'|translate}}"></div><div class="bet-history-icon express-icon" ng-if="bet.amount && !bet.bonus_bet_amount && !bet.client_bonus_id && bet.bonus" title="{{\'Express Bonus\'|translate}}"></div>');
b.put("templates/livebox/campaign.html",'<div ng-controller=campaignCtrl class="dilijan-pp balance-lightbox-j" ng-init=loadCampaignCodes()><article><ul><li><h5 ng-show=!campaignCode.loadingCodes trans></h5><form ng-show=!campaignCode.loadingCodes><label><input type=text ng-model=campaignCode.value prevent-input=[^a-zA-Z0-9]></label> <button ng-click=checkCampaignCode() ng-disabled="campaignCode.value === \'\' || campaignCode.checkingCode" trans>Check</button></form></li><li><div class=game-torunament-section-j ng-show=!campaignCode.loadingCodes><table><tr><td trans>Code</td><td trans>Instant Winning</td><td trans>Draw Number</td></tr><tr ng-repeat="code in codes track by code.Id"><td ng-bind=code.Code trans></td><td ng-if="code.WonType == 0" trans>No instant winning</td><td ng-if="code.WonType == 1" trans>Won Ball</td><td ng-if="code.WonType == 2" trans>Won T-Shirt</td><td ng-if="code.WonType == 3" trans>Won 1 Box of Dilijan beer</td><td ng-if="code.WonType == 4" trans>Won Cap</td><td ng-if="code.WonType == 5" trans>Won Wallet</td><td ng-bind=code.CodeId trans></td></tr></table></div><vbet-loader ng-show=campaignCode.loadingCodes></vbet-loader></li></ul></article></div>');
b.put("templates/livebox/cashBackCashOut.html",'<div class=mixed-view-content ng-controller=cashBackCashOutCtrl><div class=mixed-view-body><div class=mixed-view-body-ins><div class=balance-lightbox-j><div class=mixed-tickets-content-j><vbet-loader ng-show=isLoading></vbet-loader><div class=cashback-out><div class=cashback-amount-block ng-repeat="bonus in availableBonuses track by bonus.BonusDefinitionId"><span class=bonus-category>{{bonus.CategoryName|translate}}</span><div class=amount-line><div><p><span class=amount-title trans>Available For Cashout</span> <span class=amount-value ng-if=!bonus.cashBackCashOut trans>*** ***</span> <span class=amount-value ng-if=bonus.cashBackCashOut>{{bonus.cashBackCashOut.Amount|number:$root.conf.balanceFractionSize}} <i>{{$root.profile.currency_name|currency}}</i></span></p></div><div><button ng-if=!bonus.cashBackCashOut.Amount ng-disabled="bonus.cashBackCashOut && !bonus.cashBackCashOut.Amount" ng-click=calculateCashOutAmount(bonus.BonusDefinitionId) ng-class="{\'default\': !bonus.cashBackCashOut}" trans>Get Cashback Amount</button> <button ng-if=bonus.cashBackCashOut.Amount ng-click="processCashOutAmount(bonus.BonusDefinitionId, bonus.cashBackCashOut.Amount)" trans>Cashback Cashout</button></div></div></div><p class=non-bonus ng-if="!isLoading && !availableBonuses.length" trans>You do not have available bonuses</p></div></div><div class=promotions-balance-j><div ng-controller=cmsPagesCtrl ng-init="gePageBanners(\'casino\',\'casino-cash-back-out-\' + $root.env.lang);"><vbet-big-slider class=big-slider-casino-directive ng-if=casinoTopBanners.length images=casinoTopBanners link-click-handler=openCBannerLink slider-template=true></vbet-big-slider></div></div></div></div></div></div>');
b.put("templates/livebox/friendReferral.html",'<div class=friend-referral ng-init=initFriendReferral()><h3 trans>Friend Referral</h3><div class="settings-info-contain deposit-limit"><p>Please add friend referral description</p><div class=referral-info><div><label trans>Promo Code</label><div>{{profile.username}}</div></div><div><label trans>Period</label><div class=select-block><select ng-model=selectedFriendRefData.date ng-options="date.text for date in refDatesArray" ng-change=loadFriendReferralData()></select></div></div></div><label class=results-live-j ng-hide=true><input type=checkbox> <i></i> <span trans>Active players only</span></label><vbet-loader ng-show=loadingReferralsList></vbet-loader><div ng-show=!loadingReferralsList><table><tr><th trans>Player Name</th><th trans>Win or loss</th></tr></table><div class=referral-table><table><tr ng-repeat="subClient in friendReferralList track by subClient.client_id"><td ng-bind=subClient.name></td><td ng-bind=subClient.profit></td></tr></table></div><table class=ref-total><tr><th trans>Total</th><th>{{friendReferralData.bonus_percent}}%</th></tr><tr><td ng-bind="friendReferralData.total_amount || 0"></td><td ng-bind="friendReferralData.bonus_amount || 0"></td></tr></table></div></div></div>');
b.put("templates/livebox/gamstop.html",'<div><br><br><div class="settings-info-contain deposit-limit"><div style="text-align: center"><img src=images/VBET/GamStop.png alt=""></div><br><br><p trans>If you are considering self-exclusion, you may wish to register with GAMSTOP. GAMSTOP is a free service that enables you to self-exclude from all online gambling companies licensed in Great Britain. to find out more and to sign up with GAMSTOP please visit <a href=https://www.gamstop.co.uk target=_blank>www.gamstop.co.uk</a>.</p></div></div>');
